import { useDispatch, useSelector } from 'react-redux';
import ApiRides from '../../apis/ApiRides';
import FilterNearest from '../Filter/FilterFuncs/FilterNearest';
import FilterUpcoming from '../Filter/FilterFuncs/FilterUpcoming';
import FilterPast from '../Filter/FilterFuncs/FilterPast';
import './Rides.css';
import AllFilters from '../Filter/FilterFuncs/AllFilters';

const Rides = () => {

    const { userState, dataCheck } = useSelector( state => state.rideStore )
    const { originalRidesNearest,originalRidesPast,originalRidesUpcoming,originalRide } = useSelector( state => state.originalStore )

    const dispatch = useDispatch();

    if( userState.length !== 0 ){
        ApiRides(userState ,dispatch,dataCheck)
    }

    return(
        <div className="rides">
            <div className="container">
                { console.log(AllFilters()) }
                { FilterNearest(originalRidesNearest) !== undefined &&
                    originalRide === 'nearest' ? 
                        console.log(FilterNearest(originalRidesNearest))
                    : originalRide === 'upcoming' ?
                        FilterUpcoming(originalRidesUpcoming)
                    : originalRide === 'past' ?
                        FilterPast(originalRidesPast)
                    : <div className="ride-single not-found"> Not Rides Here </div>
                }
            </div>
        </div>
    )
}
export default Rides;
